import React from "react";
import "./AppS.css";

const profiles = [
  {
    name: "Sample Name",
    designation: "Designation",
    rating: 4,
    image: "profile1.jpg",
    review:
      "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas porttitor congue",
  },
  {
    name: "Sample Name",
    designation: "Designation",
    rating: 5,
    image: "profile2.jpg",
    review:
      "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas porttitor congue",
  },
  {
    name: "Sample Name",
    designation: "Designation",
    rating: 3,
    image: "profile3.jpg",
    review:
      "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas porttitor congue",
  },
  {
    name: "Sample Name",
    designation: "Designation",
    rating: 3,
    image: "profile4.jpg",
    review:
      "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas porttitor congue",
  },
];

function StarRating({ rating }) {
  return (
    <div className="star-rating">
      {[...Array(5)].map((_, i) =>
        i < rating ? (
          <span key={i} className="star filled">★</span>
        ) : (
          <span key={i} className="star">★</span>
        )
      )}
    </div>
  );
}

const ProfileCard = ({ profile }) => (
  <div className="profile-card">
    <div>
      <div className="profile-header">
        <div className="profile-name">{profile.name}</div>
        <div className="profile-designation">{profile.designation}</div>
      </div>
      <StarRating rating={profile.rating} />
      <div className="profile-review">{profile.review}</div>
    </div>
    <img
      src={profile.image}
      alt="profile"
      className="profile-image"
    />
  </div>
);

export default function App() {
  return (
    <div className="app-container">
      <h2>This is your sample text here. Enter your text here</h2>
      <div className="profiles-grid">
        {profiles.map((profile, idx) => (
          <ProfileCard key={idx} profile={profile} />
        ))}
      </div>
    </div>
  );
}
